#include <iostream>
#include <tuple>
using namespace std;

long long maximo(int a, int b){
    if (a == 0)
       return b;
    if (b == 0)
       return a;

    if (a == b)
        return a;
  
    if (a > b)
        return maximo(a-b, b);
    return maximo(a, b-a);
}

long long gcd(long long a, long long b){
    if (a == 0)
        return b;
    return gcd(b % a, a);
}

bool primo(int x){

    if (x <= 1)
        return false;
    if (x <= 3)
        return true;
  
    if ( (x % 2 == 0) || (x % 3 == 0) ){
      return false;}
  
    for (int i = 5; i * i <= x; i = i + 6){
      if (x % i == 0 || x % (i + 2) == 0)
        return false;}
  
    return true;
}


void raizprimitive(long long p, long long list[]){
    long pivot = 0;
    for (long long i = 2; i < p; i++)
        if (gcd(i, p) == 1){
            list[pivot] = i;
            pivot++;
            continue;
        };
 
}



